const React = require('react')

class EditRecipe extends React.Component {
    render() {
        let actionURL = "/recipes/" + this.props.index + "?_method=put"
        return (
            <html>
                <body>
                  <div>
                    <form method="POST" action={actionURL}>
                    Recipe Title: <input type="text" name="title" value={this.props.title}/><br/>
                    Ingredients (separate by comma): <input type="text" name="ingredients" value={this.props.ingredients}/><br/>
                    Instructions (separate by fullstop): <input type="text" name="instructions" value={this.props.instructions}/><br/>
                    <input type="submit"/>
                    </form>
                  </div>
                </body>
            </html>

            )
    }
}


module.exports = EditRecipe;
